import React, { useEffect, useState } from 'react'
import './App.css';

const snoowrap = require('snoowrap');

// console.log(r.getSubreddit('AskReddit').getWikiPage('bestof').content_md.then(console.log))

function App() {
  const [data, setData] = useState("");

  useEffect(() => {
    async function fetchData() {
      try {
        const r = new snoowrap({
          userAgent: 'My App',
          clientId: 'emBhpiG5YkFK9g',
          clientSecret: 'nKAvbCUe5ZVaSVAcPPfkkiAsKKs',
          refreshToken: '44510486695-kxxNEVzGQzzqCqrSLufyGFHSH6U'
        });

        var subreddit = await r.getSubreddit('AskReddit');
        var topPosts = await subreddit.getTop({time: 'week', limit: 3});

        var savedPosts = await r.getSavedContent().fetchAll();
        setData(savedPosts);

      } catch (err) {
        console.error(err);
      }
    }
    fetchData();
  }, [])

  // if(topPosts){
  //   console.log(topPosts)
  // }
  console.log(data)

  return (
    <div className="App">
      <h1>Heyy Yo</h1>
    </div>
  );
}

export default App;
